import React from "react";
import "./Introduce.scss";

function Introduce() {
    return (
        <div className="introduceWrapper">
            <div className="introCardWrapper"></div>
            <div className="introVideoWrapper"></div>
            <div className="introFooter"></div>
        </div>
    );
}

export default Introduce;
